import React from 'react';
import ReactDOM from 'react-dom';

const App = () => {
	return (
		<div>
			<label class='label' for='name'></label>
			<input type='text' id='name' />
			<button style={{backgroundColor:'blue',color:'white'}}></button>
		</div>
	)
};



ReactDOM.render(
	<App />,
	document.querySelector('#root')
);
